import { object } from "yup";

export default Object.freeze({
    ACCOUNT: 'Account',
    FEED:'Feed',
    MESSAGES:'Messages',
    LISTINGS: 'Listings',
    LOGIN: 'Login',
    LISTING_EDIT: 'ListingEdit',
    LISTING_DETAILS: 'ListingDetails',
    REGISTER: 'Register',
    WELCOME:'Welcome',
});
